/** @jsx jsx */
import React from 'react';
import { css, jsx, Global } from '@emotion/core';

import globalStyle from '../styles/global';


function Layout(props) {
  return (
    <div>
      {props.children}
      <style jsx global>{`
        body {
          margin: 0px;
          padding: 0px;
        }
      `}</style>
    </div>
  )
}

export default Layout;
